import styled from "styled-components";

export const ButtonStyle = styled("button")`
  display: flex;
  position: absolute;
  width: 324px;
  height: 49px;
  left: 26px;
  top: 658px;
`;

export const Pane = styled("div")<{ weight: number }>`
  flex: ${(props) => props.weight};
`;
